g\"/>\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\n   Name=\"Unresolved Mention\"/>\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\n   Name=\"Smart Link\"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0in;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]--></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Pozdrav momci,</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Weekly report for W50</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Created a marketing account with help of Walter, communicated to Diksha from Silverstreet to change their routing from OTP account</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Call with<span style=\"mso-spacerun: yes;\">&nbsp; </span>Viahub, and set Italy SIM, and Jordan HQ for them, no information regarding volumes. They started traffic on Jordan, Italy only tested</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Set for JT Burkina Faso SSy route from IT dec, they tested 2 times but didn&rsquo;t start traffic. There were complaints saying the route is not SS7. Will follow up on that more.</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Set for Vacotel France spam route, but they didn&rsquo;t test yet, asked several times if they will, but they said they are waiting for the customer.</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Searched from several partners route for CZ, to try to involve someone else, but the target around 0,01-0,011 is too low, no one even came back with proposed route.</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Shared new Accounts with Sanja and supported her with some introductions</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Started filling Sales Force excel</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Sent promo mail to my clients, promoting Papua</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\"><span style=\"mso-spacerun: yes;\">&nbsp;</span></span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">&nbsp;</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Plan for next week,</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">&nbsp;</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Create a promotion list and send it to all clients</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Follow up on set routes, and if someone shows interest on Papua</span></p>\n<p class=\"MsoNormal\"><span lang=\"SR-LATN-RS\">Continue filling Sales Force sheet and explore its benefits</span></p>', '2022-12-23 22:25:02', 3);

